					<div class="pdf24_01" style="left:21.7683em;top:3.8906em;"><span class="pdf24_10 pdf24_08 pdf24_11" style="word-spacing:-0.0077em;">ADVOKAT - KONSULTAN HUKUM &nbsp;</span></div>
					<div class="pdf24_01" style="left:24.51em;top:5.0306em;"><span class="pdf24_10 pdf24_08 pdf24_12" style="word-spacing:0.018em;">ARBITER - MEDIATOR &nbsp;</span></div>
					<div class="pdf24_01" style="left:18.9283em;top:10.4105em;"><span class="pdf24_13 pdf24_08 pdf24_14" style="word-spacing:-0.0516em;">SURAT KUASA KHUSUS &nbsp;</span></div>
					<div class="pdf24_01" style="left:19.2083em;top:11.9731em;"><span class="pdf24_10 pdf24_08 pdf24_15" style="word-spacing:0.0121em;">Nomor: 11/MDS/SKK/X/2025 &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.002em;top:15.1531em;"><span class="pdf24_16 pdf24_08 pdf24_17" style="word-spacing:0.0048em;">Yang bertanda tangan dibawah ini: &nbsp;</span></div>
					<div class="pdf24_01" style="left:7.122em;top:18.3747em;"><span class="pdf24_16 pdf24_08 pdf24_18">Nama &nbsp;</span></div>
					<div class="pdf24_01" style="left:7.122em;top:19.7347em;"><span class="pdf24_16 pdf24_08 pdf24_19">NIK &nbsp;</span></div>
					<div class="pdf24_01" style="left:7.122em;top:21.0547em;"><span class="pdf24_16 pdf24_08 pdf24_20">TTL &nbsp;</span></div>
					<div class="pdf24_01" style="left:14.4658em;top:18.3747em;"><span class="pdf24_16 pdf24_08 pdf24_21" style="word-spacing:-0.0066em;">: MUHIDIN &nbsp;</span></div>
					<div class="pdf24_01" style="left:14.3658em;top:19.7347em;"><span class="pdf24_16 pdf24_08 pdf24_22" style="word-spacing:0.0108em;">: 3201190709750004 &nbsp;</span></div>
					<div class="pdf24_01" style="left:14.4258em;top:21.0547em;"><span class="pdf24_16 pdf24_08 pdf24_23" style="word-spacing:-0.0068em;">: Bogor, 07 September 1975 &nbsp;</span></div>
					<div class="pdf24_01" style="left:7.122em;top:22.5747em;"><span class="pdf24_16 pdf24_08 pdf24_24" style="word-spacing:0.0273em;">Jenis Kelamin &nbsp;</span></div>
					<div class="pdf24_01" style="left:7.122em;top:23.9372em;"><span class="pdf24_16 pdf24_08 pdf24_25">Pekerjaan &nbsp;</span></div>
					<div class="pdf24_01" style="left:7.122em;top:25.1972em;"><span class="pdf24_16 pdf24_08 pdf24_26">Alamat &nbsp;</span></div>
					<div class="pdf24_01" style="left:14.3458em;top:22.5747em;"><span class="pdf24_16 pdf24_08 pdf24_27" style="word-spacing:-0.002em;">: Laki-laki &nbsp;</span></div>
					<div class="pdf24_01" style="left:14.2658em;top:23.9372em;"><span class="pdf24_16 pdf24_08 pdf24_28" style="word-spacing:-0.0026em;">: Wiraswasta &nbsp;</span></div>
					<div class="pdf24_01" style="left:14.2858em;top:25.1972em;"><span class="pdf24_16 pdf24_08 pdf24_29" style="word-spacing:0.0099em;">: Jl. Bogor Nirwana Residence Block E. RT 002 RW 010, &nbsp;</span></div>
					<div class="pdf24_01" style="left:15.0058em;top:26.5172em;"><span class="pdf24_16 pdf24_08 pdf24_30" style="word-spacing:0.0151em;">Kel. Rangga Mekar Kec. Bogor Selatan &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:29.3172em;"><span class="pdf24_16 pdf24_08 pdf24_31" style="word-spacing:0.0122em;">Selanjutnya disebut sebagai </span><span class="pdf24_10 pdf24_08 pdf24_24" style="word-spacing:0.0118em;">PEMBERI KUASA &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:30.6589em;"><span class="pdf24_16 pdf24_08 pdf24_32" style="word-spacing:-0.0004em;">Dalam hal ini memilih domisili hukum kuasanya, memberikan kuasanya kepada: &nbsp;</span></div>
					<div class="pdf24_01" style="left:9.9442em;top:33.3389em;"><span class="pdf24_10 pdf24_08 pdf24_33" style="word-spacing:-0.0154em;">MUHAMMAD IDRIS SAEFATURAHMAN, S.H.,CPM.,CPCLE.,CPArb. &nbsp;</span></div>
					<div class="pdf24_01" style="left:19.2483em;top:34.5789em;"><span class="pdf24_10 pdf24_08 pdf24_34" style="word-spacing:0.0009em;">ADITYA KHARISMA, S.H. &nbsp;</span></div>
					<div class="pdf24_01" style="left:16.6058em;top:35.8589em;"><span class="pdf24_10 pdf24_08 pdf24_35" style="word-spacing:-0.0475em;">MUHAMAD DARUSSALAM, S.H.,CPM &nbsp;</span></div>
					<div class="pdf24_01" style="left:19.5883em;top:37.1589em;"><span class="pdf24_10 pdf24_08 pdf24_36" style="word-spacing:0.0074em;">HENDRI PRATAMA, S.H &nbsp;</span></div>
					<div class="pdf24_01" style="left:20.7283em;top:38.3206em;"><span class="pdf24_10 pdf24_08 pdf24_37" style="word-spacing:-0.0051em;">RIDUAN SANUR, S.H &nbsp;</span></div>
					<div class="pdf24_01" style="left:16.9058em;top:39.4406em;"><span class="pdf24_10 pdf24_08 pdf24_38" style="word-spacing:0.0154em;">H. PARLINDUNGAN SIMORANGKIR &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:41.8806em;"><span class="pdf24_16 pdf24_08 pdf24_39" style="word-spacing:0.2198em;">Advokat dan Assisten Advokat pada </span><span class="pdf24_10 pdf24_08 pdf24_40" style="word-spacing:0.213em;">Kantor Hukum MDS &amp; REKAN </span><span class="pdf24_16 pdf24_08 pdf24_41" style="word-spacing:0.2482em;">yang beralamat di &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:43.2006em;"><span class="pdf24_16 pdf24_08 pdf24_42" style="word-spacing:0.0473em;">Perumahan Sukahati Residence Blok E RT 003 RW 005 Pajeleran, Sukahati, Kabupaten Bogor, &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:44.5231em;"><span class="pdf24_16 pdf24_08 pdf24_43" style="word-spacing:0.0311em;">Jawa Barat 16931, dalam hal ini dapat bertindak secara bersama-sama atau sendiri-sendiri, untuk &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:45.8431em;"><span class="pdf24_16 pdf24_08 pdf24_44" style="word-spacing:0.0178em;">selanjutnya disebut sebagai </span><span class="pdf24_10 pdf24_08 pdf24_45" style="word-spacing:0.0064em;">PENERIMA KUASA</span><span class="pdf24_16 pdf24_08 pdf24_45" style="word-spacing:0.0064em;">. &nbsp;</span></div>
					<div class="pdf24_01" style="left:7.902em;top:48.5231em;"><span class="pdf24_46 pdf24_08 pdf24_47"></span><span class="pdf24_10 pdf24_08 pdf24_48">KHUSUS</span><span class="pdf24_46 pdf24_08 pdf24_48"></span><span class="pdf24_10 pdf24_08 pdf24_48">- &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:51.1431em;"><span class="pdf24_16 pdf24_08 pdf24_49" style="word-spacing:0.1128em;">Untuk dan atas nama pemberi kuasa, mewakili, mendampingi, menghadap, serta membela hak &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:52.4647em;"><span class="pdf24_16 pdf24_08 pdf24_40" style="word-spacing:0.1342em;">dan kepentingan hukum pemberi kuasa tersebut diatas memberikan kuasa kepada kami untuk &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:53.7847em;"><span class="pdf24_16 pdf24_08 pdf24_50" style="word-spacing:0.318em;">melakukan pendampingan hukum penuh terhadap SURAT PERJANJIAN KERJASAMA </span><span class="pdf24_10 pdf24_08 pdf24_51">PT. &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:55.1047em;"><span class="pdf24_10 pdf24_08 pdf24_52" style="word-spacing:0.0593em;">MAHAPURA INDI KUSUMA </span><span class="pdf24_16 pdf24_08 pdf24_14" style="word-spacing:0.0538em;">dan </span><span class="pdf24_10 pdf24_08 pdf24_53" style="word-spacing:0.0603em;">PT. MITREKA KERTA BUMI</span><span class="pdf24_16 pdf24_08 pdf24_42" style="word-spacing:0.0583em;">, sesuai surat</span><span class="pdf24_16 pdf24_08 pdf24_34" style="word-spacing:0.4162em;">&nbsp;</span><span class="pdf24_16 pdf24_08 pdf24_54">perjanjian &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:56.4447em;"><span class="pdf24_16 pdf24_08 pdf24_55" style="word-spacing:0.0237em;">kerjasama antara Sdr. Candra Setiawan disebut sebagai PIHAK PERTAMA dan Bagus Dwi Adi &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:57.7649em;"><span class="pdf24_16 pdf24_08 pdf24_56" style="word-spacing:0.0066em;">Kusherdyono yang ditanda tangani secara bersamaan pada tanggal Bogor, 06 April 2022. &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:60.4269em;"><span class="pdf24_16 pdf24_08 pdf24_57" style="word-spacing:0.0612em;">Surat Kuasa ini diberikan dengan hak substitusi, berlaku sejak tanggal ditandatangani dan akan &nbsp;</span></div>
					<div class="pdf24_01" style="left:6.102em;top:61.7469em;"><span class="pdf24_16 pdf24_08 pdf24_58" style="word-spacing:0.0027em;">berakhir setelah urusan tersebut selesai atau dicabut secara tertulis oleh Pemberi Kuasa. &nbsp;</span></div>
